column8:
シートにかけるだけの簡単設置　短時間（約2分）で暖ったかい。<br>
座る部分も背中部分も全体発熱！加熱速度が速い！<br>
背中とおしり～太もも部分が暖かくなります。<br>
<br>
温度調整も可能（HI/LO）<br>
寒い冬の必需品！<br>
ヒーターだと車全体を温まるので、時間が掛かりますが、これならすぐに温まる！<br>
取り外しも簡単なので、春になったら取り外せます。<br>
<br>
◆電源 DC12V<br>
◆重量 500g<br>
◆電源コード長さ：シングル約120cm←右側から出ますので長さにご注意ください。<br>
サイズ： 約45cm * 95cm<br>
<br>
※説明書、化粧箱等はありません。<br>
※コードは右側から出ていますのでシガーまでの長さをお確かめの上ご購入ください<br><style>
