ほんのり温かい8つのもみ玉を搭載した本格マッサージャー。
<br><br>●本体色はビビッドなレッドを採用。
<br>●左右あわせて8つの温感もみ玉を搭載。<br>上部の2つの大きなもみ玉で柔らかなタッチとしっかりとした「もみ」を、下部の2つの小さなもみ玉で力を分散させた「ほぐし」を実現します。
<br>●「もみ」と「指圧」、さらにお尻の「バイブレーション」の組み合わせで疲れたカラダを効果的にほぐします。
<br>●操作は手元のリモコンで全て可能。<br>コース選択はもちろん、もみ位置の調整や指定、指圧のもみ玉位置幅、温感やお尻マッサージのオンオフ等、お好みに合わせて調整できます。
<br>●折りたたみ式で持ち運びもラクラク。<br>コンセントさえあれば様々なシーンで使用できます。
<br><br>仕様使用部位肩、背中、腰、尻<br>機能もみ、指圧、マッサージ
<br>電源AC100V（50/60Hz）<br>電源ケーブル長さ 約1.8m
<br>消費電力30W（ヒーター：8W）<br>色ブラック
<br>重量5.1kg<br>材質表地・裏地：ポリエステル100％、本体：ABS樹脂
<br><br>●外形寸法（背面）：約W42.5×D13.5×H66.5cm
<br>●外形寸法（座面）：約W42.0×D36×H4cm
<br>●外形寸法（折りたたみ時）：約W64×D45×H16.5cm
<br>医療機器認証番号 227AGBZX00076000<br>付属品ACアダプター、ヘッドレスト、取扱説明書・保証書
